import React from "react";

import "./SectionsManager.scss";

import {PlusCircleOutlined} from '@ant-design/icons'

const SectionsManager = () => {
    return (
        <div className="manager-container">
            <div className="manager-container__tools-menu">
                <span className="manager-container__tools-menu__">Tools menu</span>
                <label className="manager-container__tools-menu__add-btn">
                    <PlusCircleOutlined />
                    Add row
                </label>
            </div>
            <div className="manager-container__workspace">

            </div>
        </div>
    );
};

export default SectionsManager;
